function Deals() {

 const white = "white";
 const [color , setColor] = useState(white)

 const colorAdj=()=>{
  let color = "green";
  setColor(color);
 }

 return (
  <div >
   <button className="button-adj" onClick={colorAdj}
   >Buying</button>
   <button  className="button-adj1">Selling</button>
  </div>
 )
}

export default Deals
